/**
 *
 * @param {string} message
 * @param {string} fallback
 * @returns {string}
 */

const getError = (error) => {
    const errors = {
        DEFAULT: 'An error occurred. Check your settings and try again.',
        INVALID_API_URL: 'Invalid URL. Ensure your Ghost URL is correct and try again.',
        NOT_GHOST: 'No Ghost site found. Ensure your URL is correct and try again.',
        INVALID_TOKEN: 'Incorrect token. Check your Ghost API key and try again.',
        INVALID_API_KEY: 'Invalid API key. Check your settings and try again.',
        CORS: 'Permission not granted. Confirm the list of allowed URLs in the extension settings.',
        NO_PERMISSION: 'Permission not granted. Submit your settings again to confirm permissions.',
        SITE_OFFLINE: 'Your Ghost site is currently offline. Contact support@ghost.org for help.',
        MAINTENANCE: 'Your Ghost site is currently in maintenance mode. Try again later.',
        DOMAIN_ERROR: 'Your custom domain is invalid. Contact support@ghost.org for help.',
        FAILED_REQUEST: 'Failed to fetch. Ensure your URL is correct and try again.',
        NO_LEXICAL: 'Unable to save. If you already have a draft post called "Bookmarked links", rename it and try again'
    };

    if (!error || !errors[error]) {
        return errors.DEFAULT;
    }

    return errors[error];
};

/**
 * Add error handling. This will send errors to the popup
 * @param {object} content
 * @param {string} content.type
 * @param {string} content.text
 * @param {string} content.uuid
 */
function sendMessageToPopup(content) {
    const {type, text, uuid} = content;
    browser.runtime.sendMessage({type, text, uuid});
}

/**
 * createJWT - takes a JWT and creates a Ghost Admin API token
 * @param {string} apiKey
 * @returns {Promise<string>} token
 */
async function createJWT(apiKey) {
    let token = null;
    const [id, secret] = apiKey.split(':');

    if (!id || !secret) {
        sendMessageToPopup({type: 'error', text: getError('INVALID_API_KEY')});
        return;
    }

    const header = {
        alg: 'HS256',
        kid: id,
        typ: 'JWT'
    };

    const issuedAt = KJUR_1.jws.IntDate.get('now');
    const expirationTime = issuedAt + 5 * 60;

    const payload = {
        iat: issuedAt, // Max 5 minutes after 'now'
        exp: expirationTime, // 'now' (max 5 minutes after 'exp')
        aud: '/admin/'
    };

    const sHeader = JSON.stringify(header);
    const sPayload = JSON.stringify(payload);

    try {
        token = KJUR_1.jws.JWS.sign('HS256', sHeader, sPayload, secret);
    } catch (e) {
        sendMessageToPopup({type: 'error', text: getError('INVALID_API_KEY')});
    }

    return token;
}

/**
 *
 * @param {string} apiUrl
 * @returns {string}
 */
const getAdminUrl = apiUrl => `${apiUrl}/ghost/api/admin/posts/`;

/**
 *
 * @param {string} token
 * @returns {object}
 */
const getHeaders = token => ({
    Authorization: `Ghost ${token}`,
    'Content-Type': 'application/json',
    Origin: 'null',
    'Accept-Version': 'v5.0'
});

/**
 *
 * @param {object} data
 * @param {string} data.apiUrl
 * @param {string} data.token
 * @returns {Promise<object[]>}
 */
async function fetchPosts({apiUrl, token}) {
    const url = getAdminUrl(apiUrl);

    const headers = getHeaders(token);

    // Fetch post with title 'Bookmarked links'
    const getPostsRequestUrl = new URL(url);
    getPostsRequestUrl.searchParams.append('filter', `title:'Bookmarked links'+status:draft`);
    getPostsRequestUrl.searchParams.append('order', 'published_at asc');
    getPostsRequestUrl.searchParams.append('limit', '1');
    getPostsRequestUrl.searchParams.append('formats', 'lexical');

    const response = await fetch(getPostsRequestUrl, {headers});

    if (!response.ok) {
        const {errors} = await response.json();
        throw new Error(errors?.[0]?.message ?? 'Could\'t fetch posts.');
    }

    // Handle Ghost specific errors if site is offline or has other issues
    if (response?.url.match(/offline|sleep.ghost.org/igm)) {
        throw new Error(getError('SITE_OFFLINE'));
    } else if (response?.url.match(/maintenance.ghost.org/igm)) {
        throw new Error(getError('MAINTENANCE'));
    } else if (response?.url.match(/domain.ghost.org/igm)) {
        throw new Error(getError('DOMAIN_ERROR'));
    }

    const {posts} = await response.json();

    return posts;
}

